import React, { useEffect, useState } from "react";
import axios from "axios";
import img1 from "../../assets/images/homepage/fashionshoes.jpg";
import img2 from "../../assets/images/homepage/lining-running-shoes.jpg";
import img3 from "../../assets/images/homepage/lining-kids.webp";
import img4 from "../../assets/images/homepage/running.png";
import img5 from "../../assets/images/homepage/training.png";
import img6 from "../../assets/images/homepage/badminton.webp";
const Homepage1 = () => {
  const [Homepage1Data, setData] = useState([]);
  useEffect(() => {
    axios
      .get("https://admin.lining.com.np/api/home")
      .then((response) => {
        console.log("res", response);
        setData(response.data.items);
      })
      .catch((e) => {
        console.log("e", e);
      });
  }, []);
  return (
    <>
      <section className="desc-banner-1">
        <div className="container">
          <p>First Look</p>
          <h3>LI-NING AIR MAX PULSE</h3>
          <p>
            Extreme comfort. Hyper durable. Max volume. Introducing the Air Max
            Pulse ---designed to push you past your limits and help you go to
            the max.
          </p>
          <div className="btn-grp">
            <button className="btn-1">Notify Me</button>
            <button className="btn-1">Shop Air Max</button>
          </div>
        </div>
      </section>
      <section className="category">
        <div className="container">
          <div className="row row-cols-2 row-cols-md-4 g-4">
            {Homepage1Data.map((items) => {
              return <div>{items.id}</div>;
            })}
            <div className="col">
              <div className="card h-100">
                <img src={img1} className="card-img-top" alt="..." />
                <div className="card-body">
                  <h5 className="card-title">FASHION SHOES</h5>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Homepage1;
